# {{feminine singular of|fr|assassiné}}
#* {{quote-text|fr|year=1785|author=Donatien Alphonse François de Sade|title=[[s:fr:Les Cent Vingt Journées de Sodome - XXXVI|Les 120 journées de Sodome, ou l'École du libertinage]]
|passage=Le même homme, le duc de Florville, dont Duclos a parlé, la seconde du 29 novembre, le même aussi que la cinquième du 26 février, de Desgranges, veut qu'on place sur un lit de satin noir un beau cadavre de fille venant d'être '''assassinée'''; il le manie dans tous les sens et l'encule.
|translation=The same man, the duke of Florville, that Duclos talked about, the second of the 29th of November, the same as well as the fifth on the 26th of February, from Desgranges, wants placed on the black satin bed a pretty corpse of a freshly-'''assassinated''' girl; he plays with it every way possible and fucks it.}}
